import '../styles/Todo.css'

class Todo extends Component {
  constructor(props){
    super(props);

    this.toDoRemove=this.toDoRemove.bind(this)
}
toDoRemove(e){        
    this.props.toDoListRemove(e.target.id);
}
render(){
    return(<li>{this.props.todo.value}<button id={this.props.todo.id} onClick={this.toDoRemove}>Remove</button>

    </li>)
}

  }

  export default Todo
